INSERT INTO `tabDocType` VALUES ('Account','2012-10-02 13:18:31','2012-07-11 13:58:44','Administrator','Administrator',0,NULL,NULL,NULL,1,'debit_or_credit, group_or_ledger',NULL,NULL,1,'Accounts',NULL,NULL,'An **Account** is heading under which financial and business transactions are carried on. For example, “Travel Expense” is an account, “Customer Zoe”, “Supplier Mae” are accounts. \n\n**Note:** ERPNext creates accounts for Customers and Suppliers automatically.\n\n### Groups and Ledgers\n\nThere are two main kinds of Accounts in ERPNext - Group and Ledger. Groups can have sub-groups and ledgers within them, whereas ledgers are the leaf nodes of your chart and cannot be further classified.\n\nAccounting Transactions can only be made against Ledger Accounts (not Groups)\n','White:FFF',NULL,1,0,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'Tray',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,1,NULL,'Master',NULL,NULL,'1325570645','Standard',NULL,NULL),('Account Balance','2012-05-08 11:38:33','2012-03-27 14:35:40','Administrator','Administrator',0,NULL,NULL,NULL,1,'account, period, fiscal_year, balance',NULL,0,6,'Accounts','_ACB.######',NULL,NULL,'White:FFF',NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Simple',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1322549700','Standard',NULL,NULL),('Activity Type','2012-05-08 11:38:38','2012-03-27 14:36:05','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,NULL,NULL,12,'Projects','field:activity_type',NULL,NULL,'White:FFF',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Simple',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('Address','2012-07-12 19:25:52','2012-07-02 20:24:15','Administrator','Administrator',0,NULL,NULL,NULL,1,'customer, supplier, sales_partner, country, state',NULL,NULL,1,'Utilities',NULL,NULL,NULL,'White:FFF',NULL,NULL,0,NULL,NUL