0,NULL,NULL,NULL,'Tray',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1327389019','Standard',NULL,NULL),('Cost Center','2012-10-02 13:18:20','2012-07-11 14:41:39','Administrator','Administrator',0,NULL,NULL,NULL,1,'name,parent_cost_center',NULL,NULL,1,'Accounts','field:cost_center_name',NULL,'**Chart of Accounts** is mainly for reporting information for governmental purposes and less for how business actually performs. \n\nMost businesses have multiple activities like different product lines, market segments, areas of business that share some common overheads but should ideally have their own structure to report whether they are profitable or not. For this purpose, there is an alternate structure, called the **Cost Centers**.\n\nA tree of **Cost Centers** to cab be designed to reflect the different units of an organization. Each Income / Expense entry is also tagged against a **Cost Center** and hence you can get Profit and Loss against a **Cost Center** too.\n\n### Budgeting\n\n**Cost Centers** can be used for budgeting purposes too. A budget can be set against each **Account** and the system will either stop, warn or ignore the budget based on the settings in the **Company** master.\n\nBudgets can also be distributed seasonally using **Budget Distribution**.','White:FFF',NULL,1,0,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,'Simple',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,1,NULL,'Master',NULL,NULL,'1317365120','Standard',NULL,NULL),('Country','2012-05-08 11:38:43','2012-03-27 14:36:19','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,NULL,NULL,11,'Setup','field:country_name',NULL,NULL,'White:FFF',0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Simple',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Master',NULL,NULL,NULL,NULL,NULL,NULL),('Currency','2012-10-02 13:18:37','2012-07-11 16:11:45','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,N