e (like shipping) or expense it needs to be booked against a Cost Center.\n4. Description: Description of the tax (that will be printed in invoices / quotes).\n5. Rate: Tax rate.\n6. Amount: Tax amount.\n7. Total: Cumulative total to this point.\n8. Enter Row: If based on \"Previous Row Total\" you can select the row number which will be taken as a base for this calculation (default is the previous row).\n9. Consider Tax or Charge for: In this section you can specify if the tax / charge is only for valuation (not a part of total) or only for total (does not add value to the item) or for both.\n10. Add or Deduct: Whether you want to add or deduct the tax.','White:FFF',NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Simple',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,1,NULL,'Master',NULL,NULL,'1325570646','Standard',NULL,NULL),('Quality Inspection','2012-05-08 11:38:39','2012-03-27 14:45:50','Administrator','Administrator',0,NULL,NULL,NULL,1,'item_code, report_date, purchase_receipt_no, delivery_note_no',NULL,NULL,38,'Buying','QAI/.######',NULL,NULL,'White:FFF',NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Simple',NULL,NULL,NULL,NULL,NULL,NULL,' ','Yes',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1317365120','Standard',1,NULL),('Quality Inspection Reading','2012-05-08 11:38:40','2012-03-27 14:35:52','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,NULL,1,2,'Buying','QASD/.#####',NULL,NULL,'White:FFF',NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tray',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('Question','2012-10-02 13:18:13','2012-03-27 14:36:01','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,NULL,NULL,7,'Utilities','QUES.#######',NULL,NULL,'White:FFF',1,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,'Simple',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NU