rn \'SELECT `tabTerritory`.`name`,`tabTerritory`.`parent_territory` FROM `tabTerritory` WHERE `tabTerritory`.`is_group` = \"No\" AND `tabTerritory`.`docstatus`!= 2 AND `tabTerritory`.%(key)s LIKE \"%s\"  ORDER BY  `tabTerritory`.`name` ASC LIMIT 50\';\n}',NULL,'class DocType:\n  def __init__(self, d, dl):\n    self.doc, self.doclist = d, dl\n\n  def get_open_sales_order(self):\n    if not (self.doc.from_date and self.doc.to_date):\n      msgprint(\"From Date and To Date are Mandatory\")\n      return\n    \n    cond = \'\'  \n    if self.doc.customer:\n      cond += \" AND t1.customer = \'%s\' \" % self.doc.customer\n    if self.doc.sales_order:\n      cond += \" AND t1.name = \'%s\' \" % self.doc.sales_order\n    if self.doc.territory:\n      cond += \" AND t1.territory = \'%s\' \" %self.doc.territory\n\n    dl = sql(\"select distinct t1.name, t1.customer,  t1.delivery_date, t1.territory, t1.rounded_total from `tabSales Order` t1, `tabSales Order Detail` t2 where  t1.transaction_date >= \'%s\' and t1.transaction_date <= \'%s\' and t1.docstatus=1 and t1.status != \'Completed\' and t1.name = t2.parent and t2.docstatus =1 and t2.qty > t2.delivered_qty and (t2.confirmation_date is null or t2.confirmation_date= \'\' or t2.confirmation_date=\'0000-00-00\') %s\"% (self.doc.from_date, self.doc.to_date, cond)) \n    self.doc.clear_table(self.doclist, \'entries\')\n    count = 0 \n    for d in dl:\n      nl = addchild(self.doc, \'entries\', \'Update Delivery Date Detail\', 1, self.doclist)\n      nl.sales_order_no = str(d[0])\n      nl.customer = str(d[1])\n      nl.territory = str(d[3])\n      nl.rounded_total = str(d[4])\n      nl.delivery_date = str(d[2])\n      count = count +1\n    if not count:\n      msgprint(\"No Sales Order found as per filters set.\")\n\n  def update_sales_order(self):\n    for d in getlist(self.doclist, \'entries\'):\n      if d.confirmation_date:\n        sql(\"update `tabSales Order Detail` set confirmation_date = %s where parent = %s \", (d.confirmation_date, d.sales_order_no))\n    msgprint(\"Updated\")',NULL,NULL,' ','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('UserRole','2012-10-02 13:18:05','2012-07-13 12:25:07','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,0,0,1,'Core','UR.#####',NULL,NULL,'White:FFF',0,NULL,0,NULL,NULL,NULL,0,0,0,NULL,0,0,NULL,NULL,NULL,'Simple',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('Valuation Control','2012-05-08 11:38:28','2012-03-27 14:36:40','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,1,NULL,4,'Stock',NULL,NULL,NULL,'White:FFF',NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Simple',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('Warehouse','2012-10-02 13:18:18','2012-07-11 10:18:07','Administrator','Administrator',0,NULL,NULL,NULL,1,'warehouse_type',NULL,NULL,1,'Stock','field:warehouse_name',NULL,'A logical Warehouse against which stock entries are made.\n\nThere are two main Warehouse Types that are significant in ERPNext.\n\n1. **Stores:** These are where your incoming **Items** are kept before they are consumed or sold. You can have as many “Stores” type **Warehouses** as you wish. Stores type warehouses are significant because if you set an Item for automatic re-order, ERPNext will check its quantities in all “Stores” type **Warehouses** when deciding whether to re-order or not.\n\n2. **Asset**: **Items** marked as type “Fixed Asset” are maintained in Asset Type **Warehouses**. This helps you separate them for the **Items** that are consumed as a part of your regular operations or “Cost of Goods Sold”.\n','White:FFF',NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tabbed',NULL,NULL,NULL,NULL,NULL,NULL,' ',NULL,NULL,NULL,NULL,NULL,1,NULL,'Master',NULL,NULL,'1319016431','Standard',NULL,NULL),('Warehouse Type','2012-05-08 11:38:43','2012-03-27 14:36:26','A