INSERT INTO `tabPrint Format` VALUES ('Cheque Printing Format','2012-05-08 11:38:12','2012-05-08 08:08:12','Administrator','Administrator',0,NULL,NULL,NULL,1,'<!--  p.big {line-height: 200%}  .noborder td { border: 0px solid #fff; }   -->\n<div style=\"position: relative;\">\n<h3><script>doc.company</script><br /> <br /> \n<hr />\nPAYMENT ADVICE</h3>\n<table class=\"noborder\" style=\"width: 100%;\">\n<tbody>\n<tr>\n<td style=\"vertical-align: top;\" width=\"50%\">To :<br />\n<script type=\"text/javascript\">// <![CDATA[\ndoc.pay_to_recd_from\n// ]]></script>\n</td>\n<td width=\"50%\">\n<table class=\"noborder\" width=\"100%\">\n<tbody>\n<tr>\n<td width=\"30%\">Voucher No :</td>\n<td width=\"70%\">\n<script type=\"text/javascript\">// <![CDATA[\ndoc.name\n// ]]></script>\n</td>\n</tr>\n<tr>\n<td width=\"30%\">Voucher Date :</td>\n<td width=\"70%\">\n<script type=\"text/javascript\">// <![CDATA[\ndate.str_to_user(doc.voucher_date)\n// ]]></script>\n</td>\n</tr>\n<tr>\n<td width=\"30%\">Cheque No :</td>\n<td width=\"70%\">\n<script type=\"text/javascript\">// <![CDATA[\ndate.str_to_user(doc.cheque_no)\n// ]]></script>\n</td>\n</tr>\n<tr>\n<td width=\"30%\">Cheque Date :</td>\n<td width=\"70%\">\n<script type=\"text/javascript\">// <![CDATA[\ndate.str_to_user(doc.cheque_date)\n// ]]></script>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>\n<br /> <strong>We are pleased to enclose our cheque in full/part Settlement of your under noted bills</strong> <br /> \n<hr />\n<table class=\"noborder\" width=\"100%\">\n<tbody>\n<tr>\n<td width=\"70%\">&nbsp;</td>\n<td width=\"15%\">Total :</td>\n<td class=\"pos_left\" width=\"15%\">\n<script type=\"text/javascript\">// <![CDATA[\ndoc.total_amount\n// ]]></script>\n</td>\n</tr>\n<tr>\n<td colspan=\"3\">Narration :\n<script type=\"text/javascript\">// <![CDATA[\nreplace_newlines(doc.remark)\n// ]]></script>\n<br /><br /><br /></td>\n</tr>\n</tbody>\n</table>\n<div style=\"position: absolute; top: 14cm; left: 0cm;\">Prepared By</div>\n<div style=\"position: absolute; top: 14cm; left: 5.5cm;\">Authorised Signatory</div>\n<div style=\"position: absolute; top: 14cm; left: 11cm;\">Received Payment as Above</div>\n<div style=\"position: absolute; top: 16.4cm; left: 5.9cm;\"><strong>_____________</strong></div>\n<div style=\"position: absolute; top: 16.7cm; left: 6cm;\"><strong>A/c Payee</strong></div>\n<div style=\"position: absolute; top: 16.7cm; left: 5.9cm;\"><strong>_____________</strong></div>\n<div style=\"position: absolute; top: 16.9cm; left: 12cm;\">\n<script type=\"text/javascript\">// <![CDATA[\ndate.str_to_user(doc.cheque_date)\n// ]]></script>\n</div>\n<div style=\"position: absolute; top: 17.9cm; left: 1cm;\">\n<script type=\"text/javascript\">// <![CDATA[\ndoc.pay_to_recd_from\n// ]]></script>\n</div>\n<div style=\"position: absolute; top: 18.6cm; left: 1cm; width: 7cm;\">\n<script type=\"text/javascript\">// <![CDATA[\ndoc.total_amount_in_words\n// ]]></script>\n</div>\n<div style=\"position: absolute; top: 19.7cm; left: 12cm;\">\n<script type=\"text/javascript\">// <![CDATA[\ndoc.total_amount\n// ]]></script>\n</div>\n</div>','Accounts','Yes','Journal Voucher',NULL,NULL),('Delivery Note Classic','2012-05-08 11:38:12','2012-05-08 08:08:12','Administrator','Administrator',0,NULL,NULL,NULL,1,'<!--\n	Sample Print Format for ERPNext\n	Please use at your own discretion\n	For suggestions and contributions:\n		https://github.com/webnotes/erpnext-print-templates\n\n	Freely usable under MIT license\n-->\n\n<!-- Style Settings -->\n<style>\n	/*\n		common style for whole page\n		This should include:\n		+ page size related settings\n		+ font family settings\n		+ line spacing settings\n	*/\n	@media screen {\n		body {\n			width: 8.3in;\n		}\n	}\n\n	html, body, div, span, td {\n		font-family: \"Georgia\", serif;\n		font-size: 12px;\n	}\n\n	body {\n		padding: 10px;\n		margin: auto;\n		font-size: 12px;\n		line-height: 150%;\n	}\n\n	.common {\n		font-family: \"Georgia\", serif !important;\n		font-size: 12px;\n		padding: 10px 0px;\n	}\n\n	table {\n		border-collapse: collapse;\n		width: 100%;\n		vertical-align: top;\n	}\n\n	table td {\n		padding: 2px 0px;\n	}\n	\n	table h1, h2, h3, h4, h5, h6 {\n		padding: 0px;\n		margin: 0px;\n	}\n\n	table.header-table td {\n		vertical-align: top;\n	}\n\n	table.header-table thead {\n		border-bottom: 1px solid black;\n	}\n\n	table.header-table h3 {\n		color: gray;\n	}\n\n	table.header-table thead td {\n		padding: 5px 0px;\n	}\n\n	div.page-body table td:nth-child(6),\n	div.page-body table td:nth-child(7) {\n		text-align: right;\n	}\n\n	table.footer-table td {\n		vertical-align: top;\n	}\n\n	table.footer-table td table td:nth-child(2),\n	table.footer-table td table td:nth-child(3) {\n		text-align: right;\n	}\n</style>\n\n\n<!-- Javascript -->\n<script>\n	si_std = {\n		print_item_table: function() {\n			var table = print_table(\n				\'Delivery Note\',\n				doc.name,\n				\'delivery_note_details\',\n				\'Delivery Note Item\',\n				[// Here specify the table columns to be displayed\n					\'SR\', \'item_code\', \'item_name\', \'description\', \'qty\', \'stock_uom\',\n					\'basic_rate\', \'amount\'\n				],\n				[// Here specify the labels of column headings\n					\'Sr\', \'Item Code\', \'Item Name\', \'Description\', \'Qty\',\n					\'UoM\', \'Basic Rate\', \'Amount\'\n				],\n				[// Here specify the column widths\n					\'3%\', \'10%\', \'15%\', \'32%\', \'5%\',\n					\'5%\', \'15%\', \'15%\'\n				],\n				null,\n				null,\n				{\n					\'description\' : function(data_row) {\n						var to_append = \'\'\n						if(data_row.adj_rate){\n							to_append = \'<div style=\"padding-left: 15px;\"><i>Discount: \' + \n								data_row.adj_rate + \'% on \' + doc.currency + \' \' +\n								fmt_money(data_row.ref_rate) + \'</i></div>\';\n							if(data_row.description.indexOf(to_append)==-1) {\n								data_row.description = data_row.description + to_append;\n							}\n						}\n						\n						if(data_row.serial_no) {\n							to_ap