ppendChild) {\n				out = table.innerHTML;\n			} else {\n				out = \'\';\n				for(var i=0; i < (table.length-1); i++) {\n					out += table[i].innerHTML + \n						\'<div style = \"page-break-after: always;\" \\\n						class = \"page_break\"></div>\\\n						<div class=\"page-settings\"></div>\';\n				}\n				out += table[table.length-1].innerHTML;\n			}\n			return out;\n		},\n\n\n		print_other_charges: function(parent) {\n			var oc = getchildren(\'Sales Taxes and Charges\', doc.name, \'other_charges\');\n			var rows = \'<table width=100%>\\n\';\n			for(var i=0; i<oc.length; i++) {\n				if(!oc[i].included_in_print_rate) {\n					rows +=\n						\'<tr>\\n\' +\n							\'\\t<td>\' + oc[i].description + \'</td>\\n\' +\n							\'\\t<td></td>\\n\' +\n							\'\\t<td width=38%>\' + fmt_money(oc[i].tax_amount) + \'</td>\\n\' +\n						\'</tr>\\n\';\n				}\n			}\n			return rows + \'</table>\\n\';\n		}\n	};\n</script>\n\n\n<!-- Page Layout Settings -->\n<div class=\'common page-header\'>\n	<!-- \n		Page Header will contain\n			+ table 1\n				+ table 1a\n					- Name\n					- Address\n					- Contact\n					- Mobile No\n				+ table 1b\n					- Voucher Date\n					- Due Date\n	-->\n	<table class=\'header-table\' cellspacing=0>\n		<thead>\n			<tr><td colspan=2><script>\'<h1>\' + (doc.select_print_heading || \'Delivery Note\') + \'</h1>\'</script></td></tr>\n			<tr><td colspan=2><h3><script>cur_frm.docname</script></h3></td></tr>\n		</thead>\n		<tbody>\n			<tr>\n				<td width=60%><table width=100% cellspacing=0><tbody>\n					<tr>\n						<td width=22%><b>Name</b></td>\n						<td><script>doc.customer_name</script></td>\n					</tr>\n					<tr>\n						<td><b>Address</b></td>\n						<td><script>replace_newlines(doc.address_display)</script></td>\n					</tr>\n					<tr>\n						<td><b>Contact</b></td>\n						<td><script>doc.contact_display</script></td>\n					</tr>\n				</tbody></table></td>\n				<td><table width=100% cellspacing=0><tbody>\n					<tr>\n						<td width=63%><b>Delivery Note Date</b></td>\n						<td><script>date.str_to_user(doc.transaction_date)</script></td>\n					<tr>					\n					<tr>\n						<td><b>Sales Order No.</b></td>\n						<td>\n							<script>doc.sales_order_no</script><br />\n							<i>(<script>date.str_to_user(doc.posting_date)</script>)</i>\n						</td>\n					<tr>					\n				</tbody></table></td>\n			</tr>\n		</tbody>\n		<tfoot>\n		\n		</tfoot>\n	</table>\n</div>\n<div class=\'common page-body\'>\n	<!-- \n		Page Body will contain\n			+ table 2\n				- Sales Invoice Data\n	-->\n	<script>si_std.print_item_table()</script>\n</div>\n<div class=\'common page-footer\'>\n	<!-- \n		Page Footer will contain\n			+ table 3\n				- Terms and Conditions\n				- Total Rounded Amount Calculation\n				- Total Rounded Amount in Words\n	-->\n	<table class=\'footer-table\' width=100% cellspacing=0>\n		<thead>\n			\n		</thead>\n		<tbody>\n			<tr>\n				<td width=60% style=\'padding-right: 10px;\'>\n					<b>Terms, Conditions &amp; Other Information:</b><br />\n					<script>doc.terms</script>\n				</td>\n				<td>\n					<table cellspacing=0 width=100%><tbody>\n						<tr>\n							<td>Net Total</td>\n							<td></td>\n							<td width=38%><script>\n								fmt_money(doc.net_total)\n							</script></td>\n						</tr>\n						<tr><td colspan=3><script>si_std.print_other_charges()</script></td></tr>\n						<tr>\n							<td>Grand Total</td>\n							<td></td>\n							<td><script>\n								fmt_money(doc.grand_total_export)\n							</script></td>\n						</tr>\n						<tr style=\'font-weight: bold\'>\n							<td>Rounded Total</td>\n							<td><script>doc.currency</script></td>\n							<td><script>\n								fmt_money(doc.rounded_total_export)\n							</script></td>\n						</tr>\n					</tbody></table>\n					<br /><b>In Words</b><br />\n					<i><script>doc.in_words_export</script></i>\n				</td>\n			</tr>		\n		</tbody>\n		<tfoot>\n		\n		</tfoot>\n	</table>\n</div>\n','Stock','Yes','Delivery Note',NULL,NULL),('Form 16A Print Format','2012-05-08 11:38:12','2012-05-08 08:08:12','Administrator','Administrator',0,NULL,NULL,NULL,1,'<html>\n  <script>\n     function get_letter_head() {\n	// add letter head\n	var cp = locals[\'Control Panel\'][\'Control Panel\'];\n	if(doc.letter_head)\n		var lh= cstr(_p.letter_heads[doc.letter_head]);\n	else if(cp.letter_head)\n		var lh= cp.letter_head;\n	else \n		var lh= \'\';\n		\n	return lh;\n}\n  </script>\n<body>\n<table border = \"1\" style=\'border-collapse: collapse;\'>\n <tr>\n   <td>\n    <div style=\"border-bottom: 1px solid; padding-bottom: 5px; width:100%\"><script>get_letter_head()</script></div>\n   </td>\n </tr>\n <tr>\n   <td colspan = \"3\"><h1 align = \"center\"><b>FORM No. 16 A</b></h1>\n   <p align=\"right\">Certificate No:<script>doc.name</script></p>\n   <p align = \"center\">[See rule 31 (1)(b)]</p>\n   <h2 align = \"center\"><b>Certifiction of deduction of tax at source under section 203 of the Income-tax Act, 1961</b></h2>\n   <p>[For interest on securities; dividends; interests other than \'interests on securities\';winnings from lottery or crossword puzzle;\n      winnings from horse race; payments to contractors and sub-contractors;insurance comission;payments to\n      \n      non-resident sportsmen/ sports associations;payments in respect of deposits under National Savings Scheme:\n      payments on account of repurchase of units by Mutual Fund or Unit Trust of India; commission, remuneration or prize\n     \n      on sale of lottery tickets; comission or brokerage;rent;fees for professional or technical services;royalty and any sum \n      under section 28(va);income in respect of units; payment of compensation on acquisition of certain immovable property;\n\n      other sums under section 195; income in respect of units of non-residents referred to in section 196A; income from units\n      referred to in section 196B;income from foreign currency bonds or shares of an Indian Company referred to in section</p>\n      196C; income of Foreign Institutional Investors from securities referred to in section 196D]\n   </td> \n  </tr>\n\n  <tr>\n    <td width=\"30%\">Name and address of person deducing tax</td>\n    <td width=\"40%\">Acknowledgement No.s of all quarterly statements of TDS under sub-section(3) of section 200 as provided by TIN Facilitation Centre or NSDL web-site</td>\n    <td width=\"30%\">Name and address of the person to whom payment is made or in whose account it is credited</td>\n  </tr>\n  \n  <tr>\n    <td>\n      <table>\n        <tr><script>doc.company</script></tr><br><br>\n        <tr><script>replace_newlines(doc.company_address)</script></tr>\n      </table>\n    </td>\n    <td>\n      <script>print_table(\'Form 16A\', doc.name, \'form_16A_ack_details\',\'Form 16A Ack Detail\',  [\'quarter\',\'ack_no\'], [\'Quarter\' , \'Acknowledgement No.\'] , [\'40%\',\'60%\']).innerHTML</script>\n    </td>\n    <td>\n      <table>\n        <tr><script>doc.party_name</script></tr><br><br>\n        <tr><script>replace_newlines(doc.party_address)</script></tr>\n      </table>\n    </td>\n  </tr>\n  \n  <tr>\n    <td>\n      <table>\n        <tr><b>Registration Details OF THE DEDUCTOR</b></tr><br>\n        <tr><script>replace_newlines(doc.registration_details)</script></tr>\n      </table>\n    </td>\n    \n    <td>\n      <table>\n        <tr><b><center>NATURE OF PAYMENT</center></b></tr><br><br>\n        <tr><b><center><script>doc.tds_category</script></center></b></tr>\n        \n      </table>\n    </td>\n    \n    <td>\n      <table>\n        <tr><b>PAN NO. OF THE PAYEE</b></tr><br>\n        <tr><script>doc.pan_number</script></tr>\n        \n      </table>\n    </td>\n  </tr>\n  \n  <tr>\n    <td align = \"center\" colspan =\"3\"><b>DETAILS OF PAYMENT, TAX DEDUCTION AND DEPOSIT OF TAX INTO CENTRAL GOVERNMENT ACCOUNT</b>\n    <p align = \"center\">(The deductor is to provide transaction wise details of tax deducted and deposited)</p>\n  </tr>\n  \n  <tr>\n    <td colspan=\"3\">\n      <script>print_table(\'Form 16A\', doc.name, \'form_16A_tax_details\',\'Form 16A Tax Detail\', [\'SR\',\'amount_paid\', \'date_of_payment\',\'tds_main\',\'surcharge\',\'cess_on_tds\',\'total_tax_deposited\',\'cheque_no\',\'bsr_code\',\'tax_deposited_date\',\'challan_no\'], [\'S No.\' , \'Amount paid / credited\',\'Date of payment / credit\',\'TDS (Rs.)\',\'Surcharge (Rs.)\',\'Cess on TDS(Rs.)\',\'Total Tax Deposited (Rs.)\',\'Cheque/DD no.(if any)\',\'BSR code on bank branch\', \'Date on which tax deposited(dd/mm/yy)\',\'Transfer Voucher/Challan Identification no.\'] ,  [\'3%\', \'10%\',\'10%\', \'10%\',\'10%\',\'6%\',\'10%\' ,\'10%\',\'7%\' ,\'10%\',\'7%\',\'7%\'] ).innerHTML</script>\n    </td>\n  </tr>\n  \n  <tr>\n    <td colspan=\"3\">\n      Certified that a sum of Rs. <script>doc.total_amount</script> has been deducted at source and paid to the credit of the Central Government as per details given above <br><br><br><br>\n      <p align=\"right\"> Signature of person responsible for deduction of tax \n    </td>\n  </tr>\n  \n  <tr>\n    <td colspan=\"3\">\n      <table width=\"100%\" border=\"0\">\n        <tr>\n          <td width=\"50%\">Place: <script>doc.place</script></td>\n          <td width=\"50%\" align=\"right\">Full Name: <script>doc.full_name</script></td>\n        </tr>\n        <tr>\n          <td width=\"50%\">Date: <script>date.str_to_user(doc.dt)</script></td>\n          <td width=\"50%\" align=\"right\">Designation: <script>doc.designation</script></td>\n        </tr>\n      </table>\n    </td>\n  </tr>\n  \n</table>\n</body>\n</html>','Accounts','Yes',NULL,NULL,NULL),('Payment Receipt Voucher','2012-05-08 11:38:12','2012-05-08 08:08:12','Administrator','Administrator',0,NULL,NULL,NULL,1,'<div style=\"position: relative;\">\n<h3 align=\"center\"><script>doc.company</script>\n</div>\n\n<font size=\"4\">\n<table class=\'simpletable\'>\n<tr>\n<td><b> Receipt No.: </b></td>\n<td><script>doc.name</script></td>\n</tr>\n<tr>\n<td><b> Date : </b></td>\n<td><script>date.str_to_user(doc.voucher_date)</script></td>\n</tr>      \n<tr>\n<td><b> Remark: </b></td>\n<td><script> doc.remark </script></td>\n</tr>\n<tr>\n<td><b> Received From: </b></td>\n<td><b><script> doc.pay_to_rec_from </script></b></td>\n</tr>\n</table>\n<br>\n\n<div><b><script>doc.total_amount</script></b> </td></div><br>\n<div style=\"text-align:left\"><b><script>doc.total_amount_in_words</script></b></div><br>\n<div>This receipt is issued subject to realization of the Cheque</div>\n</font>\n<br>\n<table class=\"noborder\">\n<tr>\n<td style = \"text-align = right;\"><h3>For <script>doc.company</script>,</h3><br><div>(Authorised Signatory)</div></td>\n</tr>\n</table>','Accounts','Yes','Journal Voucher',NULL,NULL),('POS Invoice','2012-05-08 11:38:12','2012-05-08 08:08:12','Administrator','Administrator',0,NULL,NULL,NULL,1,'<html>\n<head>\n<!--Other charges function-->\n<script>\nvar make_row = function(title,val,bold){\nvar bstart = \'<b>\'; var bend = \'</b>\';\nreturn \'<tr><td style=\"width:50%\">\'+(bold?bstart:\'\')+title+(bold?bend:\'\')+\'</td>\'\n        +\'<td style=\"width:20%\">\'+doc.currency+\'</td>\'\n        +\'<td style=\"width:30%;text-align:right\">\'+(val?val:\'0.00\')+\'</td>\'\n        +\'</tr>\'\n}\nvar make_row1 = function(title,val,bold){\n    var bstart = \'<b>\'; var bend = \'</b>\';\n    \n    return \'<tr style=\"font-family:courier new; line-height:150%\"><td style=\"width:50%\">\'+(bold?bstart:\'\')+title+(bold?bend:\'\')+\'</td>\'\n            +\'<td style=\"width:50%;text-align:right\">\'+(bold?bstart:\'\')+(val?val:\'0.00\')+(bold?bend:\'\')+\'</td>\'\n            +\'</tr>\'\n}\n\nfunction get_letter_head() {\n    // add letter head\n    var cp = wn.boot.control_panel;\n    if(doc.letter_head)\n        var lh= cstr(_p.letter_heads[doc.letter_head]);\n    else if(cp.letter_head)\n        var lh= cp.letter_head;\n    else \n        var lh= \'\';\n        \n    return lh;\n}\n\nfunction get_tax_details(){\n    var cl = getchildren(\'Sales Taxes and Charges\',doc.name,\'other_charges\');\n    var out = \'\';\n\n    out += \'<div><table style=\"float: right;\">\';\n    for(var i=0;i<cl.length;i++){\n        if(cl[i].tax_amount) {\n            out += make_row1(cl[i].description,fmt_money(convert_rate(cl[i].tax_amount)),0);\n        }\n    }\n    out += make_row1(\'TOTAL\',doc.currency + \" \" + fmt_money(convert_rate(doc.grand_total)),1);\n    out +=\'</table></div>\';\n    return out;\n}\n\nfunction convert_rate(val){    \n    var new_val = flt(val)/flt(doc.conversion_rate);\n    return new_val;\n}\n</script>\n<style>\n    table, td, tr, div, span {\n        font-family: courier new;\n        line-height: 200%;\n    }\n</style>\n</head>\n\n<body>\n<table width=\"100%\" style=\"font-family: courier new; line-height:200%\">\n<tr>\n    <td align=\"left\">NO: <script>doc.name</script></td>\n    <td align=\"right\">DATE: <script>date.str_to_user(doc.posting_date)</script></td>\n</tr>\n<tr>\n    <td>M/s <script>doc.contact_display</script></td>\n</tr>\n</table>\n<!--Item Table-->\n<div>\n<script>\nvar t = print_table(\'Sales Invoice\', doc.name, \'entries\', \'Sales Invoice Item\',\n        [\'description\',\'qty\',\'export_rate\',\'export_amount\'], [\'ITEM\', \'QTY\',\'RATE\',\'AMOUNT\'],\n        [\'35%\',\'20%\',\'20%\',\'25%\']);\nif(t.appendChild) { // single\n    out = t.innerHTML.replace(/style=\"/gi,\'style=\"font-family:courier new;line-height:150%;\');\n} else { //multiple\n    out = \'<table class=\"None\" border=\"0px\" width=\"100%\" style=\"border:0px; font-family:courier-new\">\';\n\n    for(var i=0;i<t.length;i++) {\n        if(i==0) {\n            out += \'<tr>\' + t[i].childNodes[0].childNodes[0].childNodes[0].innerHTML\n                .replace(/style=\"border: 1px solid rgb\\(0, 0, 0\\);/gi,\'style=\"font-family:courier new;\')\n                + \'</tr>\';\n        }\n        out += \'<tr>\' + t[i].childNodes[0].childNodes[0].childNodes[1].innerHTML\n                .replace(/style=\"border: 1px solid rgb\\(0, 0, 0\\);/g