t>\n	</table>\n</div>\n<div class=\'common page-body\'>\n	<!-- \n		Page Body will contain\n			+ table 2\n				- Sales Invoice Data\n	-->\n	<script>si_std.print_item_table()</script>\n</div>\n<div class=\'common page-footer\'>\n	<!-- \n		Page Footer will contain\n			+ table 3\n				- Terms and Conditions\n				- Total Rounded Amount Calculation\n				- Total Rounded Amount in Words\n	-->\n	<table class=\'footer-table\' width=100% cellspacing=0>\n		<thead>\n			\n		</thead>\n		<tbody>\n			<tr>\n				<td width=60% style=\'padding-right: 10px;\'>\n					<b>Terms, Conditions &amp; Other Information:</b><br />\n					<script>doc.terms</script>\n				</td>\n				<td>\n					<table cellspacing=0 width=100%><tbody>\n						<tr>\n							<td>Net Total</td>\n							<td></td>\n							<td width=38%><script>\n								fmt_money(doc.net_total_import)\n							</script></td>\n						</tr>\n						<tr><td colspan=3><script>si_std.print_other_charges()</script></td></tr>\n						<tr style=\'font-weight: bold\'>\n							<td>Grand Total</td>\n							<td><script>doc.currency</script></td>\n							<td><script>\n								fmt_money(doc.grand_total_import)\n							</script></td>\n						</tr>\n					</tbody></table>\n					<br /><b>In Words</b><br />\n					<i><script>doc.in_words_import</script></i>\n				</td>\n			</tr>		\n		</tbody>\n		<tfoot>\n		\n		</tfoot>\n	</table>\n</div>\n','Buying','Yes','Purchase Order',NULL,NULL),('Purchase Receipt Format','2012-05-08 11:38:12','2012-05-08 08:08:12','Administrator','Administrator',0,NULL,NULL,NULL,1,'<html>\n<head>\n<!--Other charges function-->\n<script>\n    var make_row = function(title,val,bold){\n    var bstart = \'<b>\'; var bend = \'</b>\';\n    return \'<tr><td style=\"width:50%\">\'+(bold?bstart:\'\')+title+(bold?bend:\'\')+\'</td>\'\n              +\'<td style=\"width:20%;text-align:right\">\'+doc.currency+\'</td>\'\n              +\'<td style=\"width:30%;text-align:right\">\'+(val?val:\'0.00\')+\'</td>\'\n              +\'</tr>\'\n  }\n\n  function get_other_charges(){\n    var out =\'\';\n    out += \'<div><table class=\"noborder\" style=\"width:100%\">\';\n    out += make_row(\'Total Amount\',fmt_money(convert_rate(doc.total_amount)),1)\n          +make_row(\'Grand Total\',fmt_money(convert_rate(doc.grand_total)),1);\n    out += \'</table></div>\';\n    return out;\n  }\n\n  function get_buying_costs(){\n    var out =\'\';\n    if(doc.buying_cost_transport || doc.buying_cost_taxes || doc.buying_cost_other){\n      out += \'<div><table class=\"noborder\" style=\"width:100%\">\'\n            + \'<tr><td style=\"width:100%\"><b>\'+\'Buying Cost Details\'+\'</b></td></tr>\';\n      if(doc.buying_cost_transport){ out += make_row(\'Transport Cost\',fmt_money(convert_rate(doc.buying_cost_transport)),0)}\n      if(doc.buying_cost_taxes){ out += make_row(\'Taxes\',fmt_money(convert_rate(doc.buying_cost_taxes)),0)}\n      if(doc.buying_cost_other){ out += make_row(\'Other Cost\',fmt_money(convert_rate(doc.buying_cost_other)),0)}\n      out += \'</table></div>\';\n    }\n    return out;\n  }\n\nfunction get_letter_head() {\n	// add letter head\n	var cp = locals[\'Control Panel\'][\'Control Panel\'];\n	if(doc.letter_head)\n		var lh= cstr(_p.letter_heads[doc.letter_head]);\n	else if(cp.letter_head)\n		var lh= cp.letter_head;\n	else \n		var lh= \'\';\n		\n	return lh;\n}\n\n  \n  function convert_rate(val){\n    var new_val = flt(val)/flt(doc.conversion_rate);\n    return new_val;\n  }\n  \n    function get_transport_details(){\n    var out = \'\';\n    if(doc.transporter_name || doc.lr_no || doc.lr_date){\n     out += \'<div><table class=\"noborder\" style=\"width:40%\">\'\n            +\'<tr><td style=\"width:80%\"><b>\' + \'Transporter Details\'+\'</b></td><td style=\"width:20%\"></td></tr>\'\n\n     if(doc.transporter_name){ out += \'<tr><td style=\"width:40%\">\' + \'Transporter Name\'+\'</td><td style=\"width:60%\">\'+doc.transporter_name+\'</td></tr>\'}\n     if(doc.lr_no){ out += \'<tr><td style=\"width:40%\">\' + \'LR No\'+\'</td><td style=\"width:60%\">\'+doc.lr_no+\'</td></tr>\'}\n     if(doc.lr_date){ out += \'<tr><td style=\"width:40%\">\' + \'LR Date\'+\'</td><td style=\"width:60%\">\'+doc.lr_date+\'</td></tr>\'}\n     out += \'</table></div>\'\n    }\n    return out;\n  }\n\n</script>\n</head>\n<body>\n<div style=\"border:1px solid black;padding:15px\">\n<!--header-->\n<div><script>get_letter_head()</script></div>\n<div style=\"border-bottom: 1px solid; padding-bottom: 5px;\">\n <div><br><b>Purchase Receipt: <script>doc.name</script></b></div>\n <div>Date: <script>date.str_to_user(doc.transaction_date)</script></div>\n</div>\n\n<div style=\"padding-top:15px\">\n<div><script>doc.supplier</script></div>\n<div><br><script>replace_newlines(doc.address_display)</script></div>\n</div>\n\n<div>\n<br>\n    <script>\n    var t = print_table(\'Purchase Receipt\', doc.name, \'purchase_receipt_details\', \'Purchase Receipt Item\', [\'SR\', \'item_code\',\'description\',\'received_qty\',\'qty\',\'rejected_qty\',\'po_rate\',\'amount\',\'billed_qty\'], [\'Sr\', \'Item Code\', \'Description\',\'Received Quantity\',\'Accepted Qty\',\'Rejected Qty\',\'Rate\',\'Amount\',\'Billed Qty\'], [\'4%\',\'12%\', \'24%\', \'10%\',\'10%\',\'10%\',\'10%\',\'10%\',\'10%\'])\n    if(t.appendChild) {\n      // single\n      out = t.innerHTML;\n    } \n    else {//multiple\n      out = \'\'\n      for(var i=0;i<t.length;i++) {\n        if(i!=t.length-1){\n          out += \'<div style:\"padding-top:5px;\"></div>\' + t[i].innerHTML +\'<div style=\"page-break-after:always\"></div>\';\n        }\n        else out += \'<div style:\"padding-top:5px;\"></div>\' + t[i].innerHTML;\n      }\n    }\n    out;\n    </script>\n\n</div>\n\n<!--Other charges table-->\n<div>\n<table style=\"width:100%\">\n  <tr><td style=\"width:40%\"><script>get_buying_costs()</script></td>\n  <td style=\"width:20%\"></td><td style=\"width:40%\"><script>get_other_charges()</script></td></tr>\n</table>\n</div>\n<div><script>get_transport_details()</script></div>\n<div><br>Payment Terms</div>\n<div><br><script>replace_newlines(doc.payment_terms)</script></div>\n<div><br>For NCSCI</div>\n<div><br><br>(Authorised Signatory)</div>\n</div></body>\n</html>','Stock','Yes',NULL,NULL,NULL),('Quotation Classic','2012-05-08 11:38:12','2012-05-08 08:08:12','Administrator','Administrator',0,NULL,NULL,NULL,1,'<!--\n	Sample Print Format for ERPNext\n	Please use at your own discretion\n	For suggestions and contributions:\n		https://github.com/webnotes/erpnext-print-templates\n\n	Freely usable under MIT license\n-->\n\n<!-- Style Settings -->\n<style>\n	/*\n		common style for whole page\n		This should include:\n		+ page size related settings\n		+ font family settings\n		+ line spacing settings\n	*/\n	@media screen {\n		body {\n			width: 8.3in;\n		}\n	}\n\n	html, body, div, span, td {\n		font-family: \"Georgia\", serif;\n		font-size: 12px;\n	}\n\n	body {\n		padding: 10px;\n		margin: auto;\n		font-size: 12px;\n		line-height: 150%;\n	}\n\n	.common {\n		font-family: \"Georgia\", serif !important;\n		font-size: 12px;\n		padding: 10px 0px;\n	}\n\n	table {\n		border-collapse: collapse;\n		width: 100%;\n		vertical-align: top;\n	}\n\n	table td {\n		padding: 2px 0px;\n	}\n	\n	table h1, h2, h3, h4, h5, h6 {\n		padding: 0px;\n		margin: 0px;\n	}\n\n	table.header-table td {\n		vertical-align: top;\n	}\n\n	table.header-table thead {\n		border-bottom: 1px solid black;\n	}\n\n	table.header-table h3 {\n		color: gray;\n	}\n\n	table.header-table thead td {\n		padding: 5px 0px;\n	}\n\n	div.page-body table td:nth-child(6),\n	div.page-body table td:nth-child(7) {\n		text-align: right;\n	}\n\n	table.footer-table td {\n		vertical-align: top;\n	}\n\n	table.footer-table td table td:nth-child(2),\n	table.footer-table td table td:nth-child(3) {\n		text-align: right;\n	}\n</style>\n\n\n<!-- Javascript -->\n<script>\n	si_std = {\n		print_item_table: function() {\n			var table = print_table(\n				\'Quotation\',\n				doc.name,\n				\'quotation_details\',\n				\'Quotation Item\',\n				[// Here specify the table columns to be displayed\n					\'SR\', \'item_code\', \'item_name\', \'description\', \'qty\', \'stock_uom\',\n					\'export_rate\', \'export_amount\'\n				],\n				[// Here specify the labels of column headings\n					\'Sr\', \'Item Code\', \'Item Name\', \'Description\', \'Qty\',\n					\'UoM\', \'Basic Rate\', \'Amount\'\n				],\n				[// Here specify the column widths\n					\'3%\', \'10%\', \'15%\', \'32%\', \'5%\',\n					\'5%\', \'15%\', \'15%\'\n				],\n				null,\n				null,\n				{\n					\'description\' : function(data_row) {\n						if(data_row.adj_rate) {\n							var to_append = \'<div style=\"padding-left: 15px;\"><i>Discount: \' + \n								data_row.adj_rate + \'% on \' + doc.currency + \' \' +\n								fmt_money(data_row.ref_rate) + \'</i></div>\';\n							if(data_row.description.indexOf(to_append)==-1) {\n								return data_row.description + to_append;\n							} else { return data_row.description; }\n						} else {\n							return data_row.description;\n						}\n					}\n				}\n			);\n\n			// This code takes care of page breaks\n			if(table.appendChild) {\n				out = table.innerHTML;\n			} else {\n				out = \'\';\n				for(var i=0; i < (table.length-1); i++) {\n					out += table[i].innerHTML + \n						\'<div style = \"page-break-after: always;\" \\\n						class = \"page_break\"></div>\\\n						<div class=\"page-settings\"></div>\';\n				}\n				out += table[table.length-1].innerHTML;\n			}\n			return out;\n		},\n\n\n		print_other_charges: function(parent) {\n			var oc = getchildren(\'Sales Taxes and Charges\', doc.name, \'other_charges\');\n			var rows = \'<table width=100%>\\n\';\n			for(var i=0; i<oc.length; i++) {\n				if(!oc[i].included_in_print_rate) {\n					rows +=\n						\'<tr>\\n\' +\n							\'\\t<td>\' + oc[i].description + \'</td>\\n\' +\n							\'\\t<td></td>\\n\' +\n							\'\\t<td width=38%>\' + fmt_money(oc[i].tax_amount) + \'</td>\\n\' +\n						\'</tr>\\n\';\n				}\n			}\n			return rows + \'</table>\\n\';\n		}\n	};\n</script>\n\n\n<!-- Page Layout Settings -->\n<div class=\'common page-header\'>\n	<!-- \n		Page Header will contain\n			+ table 1\n				+ table 1a\n					- Name\n					- Address\n					- Contact\n					- Mobile No\n				+ table 1b\n					- Voucher Date\n					- Due Date\n	-->\n	<table class=\'header-table\' cellspacing=0>\n		<thead>\n			<tr><td>\n					<script>\'<h1>\' + (doc.select_print_heading || \'Quotation\') + \'</h1>\'</script>\n			</td></tr>\n			<tr><td><h3><script>cur_frm.docname</script></h3></td></tr>\n		</thead>\n		<tbody>\n			<tr>\n				<td width=60%><table width=100% cellspacing=0><tbody>\n					<tr>\n						<td width=39%><b>Name</b></td>\n						<td><script>doc.customer?doc.customer:doc.lead_name</script></td>\n					</tr>\n					<tr>\n						<td><b>Address</b></td>\n						<td><script>replace_newlines(doc.address_display)</script></td>\n					</tr>\n					<tr>\n						<td><b>Contact</b></td>\n						<td><script>doc.contact_display</script></td>\n					</tr>\n				</tbody></table></td>\n				<td><table width=100% cellspacing=0><tbody>\n					<tr>\n						<td width=63%><b>Quotation Date</b></td>\n						<td><script>date.str_to_user(doc.transaction_date)</script></td>\n					<tr>					\n				</tbody></table></td>\n			</tr>\n		</tbody>\n		<tfoot>\n		\n		</tfoot>\n	</table>\n</div>\n<div class=\'common page-body\'>\n	<!-- \n		Page Body will contain\n			+ table 2\n				- Sales Invoice Data\n	-->\n	<script>si_std.print_item_table()</script>\n</div>\n<div class=\'common page-footer\'>\n	<!-- \n		Page Footer will contain\n			+ table 3\n				- Terms and Conditions\n				- Total Rounded Amount Calculation\n				- Total Rounded Amount in Words\n	-->\n	<table class=\'footer-table\' width=100% cellspacing=0>\n		<thead>\n			\n		</thead>\n		<tbody>\n			<tr>\n				<td width=60% style=\'padding-right: 10px;\'>\n					<b>Terms, Conditions &amp; Other Information:</b><br />\n					<script>doc.terms</script>\n				</td>\n				<td>\n					<table cellspacing=0 width=100%><tbody>\n						