`tabProject` where name= %s\", r[0])\n  \n  r.append(proj and proj[0][0] or \'\')\n  r.append(flt(proj and proj[0][1] or 0))\n  \n  pr = sql(\"SELECT SUM(net_total) FROM `tabPurchase Receipt` WHERE project_name= %s AND docstatus = 1 Group By project_name\", r[0])\n  pr = pr and pr[0][0] or 0\n  r.append(flt(pr))\n  \n  #dn = sql(\"SELECT SUM(net_total) FROM `tabDelivery Note` WHERE project_name= %s AND docstatus = 1 Group By project_name\", r[0])\n  #dn = dn and dn[0][0] or 0  \n  #r.append(flt(dn))\n  sle = sql(\"select actual_qty, valuation_rate from `tabStock Ledger Entry` where voucher_no in (SELECT name FROM `tabDelivery Note` WHERE project_name= \'%s\' AND docstatus = 1 Group By project_name) AND voucher_type = \'Delivery Note\' AND is_cancelled = \'No\'\"% (r[0]), as_dict=1)\n  calc_cost = 0\n  for y in sle:\n    cost = 0\n    cost = abs(y[\'actual_qty\']) * y[\'valuation_rate\']\n    calc_cost = calc_cost + cost\n  r.append(flt(calc_cost))\n  \n  si = sql(\"SELECT SUM(total_amount) FROM `tabStock Entry` WHERE project_name= %s AND docstatus = 1 Group By project_name\", r[0])\n  si = si and si[0][0] or 0  \n  r.append(flt(si))\n  \n  agg = flt(pr+dn+si)/4\n  r.append(flt(agg))\n  \n  total_budget += flt(r[col_idx[\'Project Value\']])\n  total_grn += flt(r[col_idx[\'Cost of all GRN\']])\n  total_deliveries += flt(r[col_idx[\'Cost of all Deliveries\']])\n  total_stock_entries += flt(r[col_idx[\'Cost of all Stock Entries\']])\n  total_agg += flt(r[col_idx[\'Aggregate value of all Movements\']])\n  \ntotal = [\'\', \'Total\', total_budget, total_grn, total_deliveries, total_stock_entries, total_agg]\nres.append(total)','DESC','`tabProject`.`name`',NULL,'Yes',50,NULL),('purchase_in_transit','2012-05-08 11:38:12','2012-05-08 08:08:12','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,'Buying','Purchase in Transit','List of PR whose posting date is after PV posting date','Purchase Invoice Item','{\"Purchase Invoice\\u0001Submitted\":1,\"Purchase Invoice\\u0001I